💢چرا رکود جهانی برای بورس تهران مهم است؟‌

♦️ برای مثال اگر با دلار  ۲۵ هزار تومانی را مبنای محاسبات قرار دهیم حتی برای شرکتی مانند فولاد مبارکه که در وضعیت بنیادی خوبی قرار دارد افت نزدیک به ۲۰۰ دلاری ورق گرم (از حوالی ۸۰۰ دلار تا کانال ۶۰۰ دلار) می‌تواند تا ۲۰ هزار میلیارد تومان از درآمد عملیاتی شرکت و شاید تا ۱۰ هزار میلیارد تومان از سود خالص شرکت بکاهد. در این میان باید توجه داشت که افت قیمت ورق گرم به عنوان محصول اصلی فولاد مبارکه می‌تواند افت قیمت سایر محصولات این شرکت را به دنبال داشته باشد و افت بیشتر سودآوری را رقم بزند. بر این اساس هراس از رکود در بازار جهانی برای بورس تهران ناشی از ترس از افت محسوس قیمت کالاهای پایه مانند فولاد و محصولات پتروشیمی است که می‌تواند اثر منفی بر سودآوری شرکت‌ها داشته باشد. 

♦️ با این حال هنوز بیش از آنکه رکود در اقتصاد جهانی رخ داده باشد هراس از احتمال وقوع رکود قیمت‌ها را نزولی ساخته است و بر این اساس همچنان تردید در این خصوص وجود دارد. این موضوع برای سایر گروه‌های کالایی نیز به نظر مشهود است و اما تنها صنعتی که فعلا در موج اخیر ریزش قیمت‌ها مقاومت داشته پالایش نفت بوده است که کرک اسپرد محصولات نسبت به مواد خام حتی بیشتر از قبل شده است و این موضوع طبیعتا اثر مثبت بر سودآوری پالایشگاه‌ها خواهد داشت. در خصوص سایر محصولات نیز روزهای گذشته به افت قیمت محصولات پتروشیمی و فلزی اشاره شد. بر این اساس هنوز لازم به نظر می‌رسد که تحولات بازار جهانی با دقت رصد شود. در این خصوص در گزارشی به اثر بحران اقتصاد جهانی در سال ۲۰۰۸ بر قیمت کالاها پرداخته شد. البته برخی کارشناسان عنوان می‌کنند که تکرار سناریو مزبور دور از انتظار است و صرفا برای حس اثر رکود بر بازار کالایی مشاهده نمودارهای این گزارش جالب توجه است. آمار تورم آمریکا برای ماه ژوئن که در هفته‌های آینده منتشر می‌شود از اهمیت زیادی برای کل اقتصاد جهانی دارا است / بورسان

